/*Table structure for table `member_notify` */

DROP TABLE IF EXISTS `member_notify`;

CREATE TABLE `member_notify` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `member_id` bigint(20) NOT NULL COMMENT '会员ID',
  `account_code` varchar(50) DEFAULT '' COMMENT '账号编码',
  `notify_type` varchar(50) DEFAULT '' COMMENT '通知类型',
  `inner_notify_message` varchar(200) DEFAULT '' COMMENT '内部通知消息',
  `inner_notify_to_page` varchar(100) DEFAULT '' COMMENT '内部消息跳转页面',
  `wx_notify_template_id` varchar(100) DEFAULT '' COMMENT 'WX通知模板ID',
  `wx_notify_data_json` varchar(500) DEFAULT '' COMMENT 'WX通知JSON串',
  `wx_notify_to_page` varchar(100) DEFAULT '' COMMENT '微信通知跳转页面',
  `sms_notify_template_code` varchar(100) DEFAULT '' COMMENT '短信通知模板编码',
  `sms_phone_number` varchar(20) DEFAULT '' COMMENT '短信通知电话号码',
  `sms_notify_data_json` varchar(500) DEFAULT '' COMMENT '短信通知JSON串',
  `cache_status` varchar(20) DEFAULT 'UNCACHE' COMMENT '通知状态:UNCACHE-未缓存,CACHED-已缓存',
  `read_status` varchar(20) DEFAULT 'UNREAD' COMMENT '通知状态:UNREAD-未读,READED-已读,DELETED-已删除',
  `send_status` varchar(20) DEFAULT 'UNSEND' COMMENT 'WX通知发送状态UNSEND-未发送;SEND-已发送',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `last_upd_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`id`),
  KEY `idx_member_notify_member_id` (`member_id`) USING BTREE,
  KEY `idx_member_notify_account_code` (`account_code`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='会员通知';

