/*Table structure for table `member_visitor_info` */

DROP TABLE IF EXISTS `member_visitor_info`;

CREATE TABLE `member_visitor_info` (
  `id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `member_id` bigint(20) DEFAULT NULL COMMENT '用户ID',
  `member_account_code` varchar(50) DEFAULT '' COMMENT '用户账号',
  `id_card_name` varchar(50) DEFAULT '' COMMENT '真实姓名',
  `id_card` varchar(50) DEFAULT '' COMMENT '身份证号码',
  `phone_number` varchar(20) DEFAULT '' COMMENT '用户手机号',
  `face_img_attchment` varchar(255) DEFAULT '' COMMENT '人脸附件-存根地址',
  `face_img_request` varchar(400) DEFAULT '' COMMENT '人脸图片-请求地址',
  `status` varchar(20) DEFAULT 'INIT' COMMENT '审核状态:INIT-草稿,UPLOAD-已认证',
  `record_version` bigint(19) NOT NULL DEFAULT '0' COMMENT '版本编码',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `create_user_code` varchar(255) DEFAULT '' COMMENT '新增用户编码',
  `create_user_name` varchar(255) DEFAULT '' COMMENT '新增用户名',
  `last_upd_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_upd_user_code` varchar(255) DEFAULT '' COMMENT '最后修改用户编码',
  `last_upd_user_name` varchar(255) DEFAULT '' COMMENT '最后修改用户名',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `uk_member_visitor_info` (`member_id`,`id_card`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='会员-会员访客信息';

