/*Table structure for table `member_wx_mp` */

DROP TABLE IF EXISTS `member_wx_mp`;

CREATE TABLE `member_wx_mp` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `openid` varchar(100) DEFAULT '' COMMENT '小程序openid',
  `unionid` varchar(200) DEFAULT '' COMMENT '微信用户唯一ID',
  `bind_member_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '绑定平台用户ID',
  `avatar_request` varchar(255) DEFAULT '' COMMENT '微信头像-访问地址',
  `nick_name` varchar(100) DEFAULT '' COMMENT '平台会员昵称',
  `city` varchar(50) NOT NULL DEFAULT '' COMMENT '城市',
  `province` varchar(50) NOT NULL DEFAULT '' COMMENT '省份',
  `country` varchar(50) NOT NULL DEFAULT '' COMMENT '国家',
  `language` varchar(50) DEFAULT '' COMMENT '语言',
  `gender` varchar(4) DEFAULT '0' COMMENT '性别(1-男,0-女)',
  `phone_number` varchar(16) DEFAULT '' COMMENT '手机号码',
  `pur_phone_number` varchar(16) DEFAULT '' COMMENT '钱包手机号码',
  `country_code` varchar(16) DEFAULT '' COMMENT '国家编码',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `status` varchar(10) DEFAULT 'NORMAL' COMMENT '用户状态:NORMAL-正常,FREEZE-冻结',
