/*Table structure for table `minichat_set` */

DROP TABLE IF EXISTS `minichat_set`;

CREATE TABLE `minichat_set` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `minichat_app_id` varchar(100) NOT NULL COMMENT '微信小程序APPID',
  `minichat_app_secret` varchar(100) NOT NULL COMMENT '微信小程序SECRET',
  `pay_customer_id` varchar(100) NOT NULL COMMENT '商户ID',
  `pay_secret` varchar(100) NOT NULL COMMENT '支付密钥',
  `notify_url` varchar(500) DEFAULT NULL COMMENT '付款回调地址',
  `refund_notify_url` varchar(500) DEFAULT NULL COMMENT '退款回调地址',
  `cert_file_path` varchar(100) DEFAULT '' COMMENT '证书存放地址',
  `record_version` bigint(19) NOT NULL DEFAULT '0' COMMENT '版本编码',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `create_user_code` varchar(255) DEFAULT '' COMMENT '新增用户编码',
  `create_user_name` varchar(255) DEFAULT '' COMMENT '新增用户名',
  `last_upd_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_upd_user_code` varchar(255) DEFAULT '' COMMENT '最后修改用户编码',
  `last_upd_user_name` varchar(255) DEFAULT '' COMMENT '最后修改用户名',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COMMENT='小程序参数配置';

/*Data for the table `minichat_set` */

