/*Table structure for table `notify_set` */

DROP TABLE IF EXISTS `notify_set`;

CREATE TABLE `notify_set` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `notify_type` varchar(50) DEFAULT '' COMMENT '通知类型',
  `is_on_inner` char(1) DEFAULT '0' COMMENT '开启平台通知',
  `is_on_wx` char(1) DEFAULT '0' COMMENT '开启微信通知',
  `is_on_sms` char(1) DEFAULT '0' COMMENT '开启SMS通知',
  `owner_type` varchar(20) DEFAULT '' COMMENT '使用人群',
  `notify_dec` varchar(200) DEFAULT '' COMMENT '消息描述',
  `inner_notify_message` varchar(200) DEFAULT '' COMMENT '内部通知消息',
  `inner_notify_to_page` varchar(100) DEFAULT '' COMMENT '内部通知消息',
  `wx_notify_template_id` varchar(100) DEFAULT '' COMMENT 'WX通知模板ID',
  `wx_notify_data_json` varchar(500) DEFAULT '' COMMENT 'WX通知JSON串',
  `wx_notify_to_page` varchar(100) DEFAULT '' COMMENT '微信通知跳转页面',
  `sms_notify_template_code` varchar(100) DEFAULT '' COMMENT '短信通知模板编码',
  `sms_phone_number` varchar(20) DEFAULT '' COMMENT '短信通知电话号码',
  `sms_notify_data_json` varchar(500) DEFAULT '' COMMENT '短信通知JSON串',
  `status` varchar(10) DEFAULT 'ENABLED' COMMENT '状态: ENABLED-有效;DISABLED-无效',
  `record_version` bigint(19) NOT NULL DEFAULT '0' COMMENT '版本编码',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `create_user_code` varchar(255) DEFAULT '' COMMENT '新增用户编码',
  `create_user_name` varchar(255) DEFAULT '' COMMENT '新增用户名',
  `last_upd_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_upd_user_code` varchar(255) DEFAULT '' COMMENT '最后修改用户编码',
  `last_upd_user_name` varchar(255) DEFAULT '' COMMENT '最后修改用户名',
  PRIMARY KEY (`id`),
  KEY `idx_notify_set_notify_type` (`notify_type`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='通知设置';

