/*Table structure for table `oc_visitor_apply` */

DROP TABLE IF EXISTS `oc_visitor_apply`;

CREATE TABLE `oc_visitor_apply` (
  `id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `member_id` bigint(20) DEFAULT NULL COMMENT '用户ID',
  `member_account_code` varchar(50) DEFAULT '' COMMENT '用户账号',
  `member_visitor_id` bigint(10) DEFAULT NULL COMMENT '用户访客信息ID',
  `oc_visitor_id` bigint(10) DEFAULT NULL COMMENT '网点访客信息ID',
  `oc_code` varchar(50) DEFAULT '' COMMENT '网点编码',
  `org_code` varchar(50) DEFAULT '' COMMENT '组织编码',
  `oc_name` varchar(50) DEFAULT '' COMMENT '网点名称',
  `org_name` varchar(50) DEFAULT '' COMMENT '组织名称',
  `oc_auth_area_code` varchar(50) DEFAULT '' COMMENT '申请权限区域编码',
  `visitor_type` varchar(20) DEFAULT '' COMMENT '访客类型:INNER_USER-内部员工,OUTER_USER-外来人员',
  `id_card_name` varchar(50) DEFAULT '' COMMENT '真实姓名',
  `id_card` varchar(50) DEFAULT '' COMMENT '身份证号码',
  `phone_number` varchar(20) DEFAULT '' COMMENT '用户手机号',
  `position_name` varchar(50) DEFAULT '' COMMENT '职位',
  `face_img_attchment` varchar(255) DEFAULT '' COMMENT '人脸附件-存根地址',
  `face_img_request` varchar(400) DEFAULT '' COMMENT '人脸图片-请求地址',
  `abstract_msg` varchar(1204) DEFAULT '' COMMENT '摘要信息，其他信息系统填充位置',
  `audit_status` varchar(20) DEFAULT 'UNAUDIT' COMMENT '审核状态:UNAUDIT-未审核,AUDITING-审核中,AUDITED-已审核,AUDITED_FAIL-审核失败',
  `audit_message` varchar(200) DEFAULT '' COMMENT '审核消息',
  `effective_time_begin` datetime DEFAULT NULL COMMENT '有效开始时间',
  `effective_time_end` datetime DEFAULT NULL COMMENT '有效结束时间',
  `record_version` bigint(19) NOT NULL DEFAULT '0' COMMENT '版本编码',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `create_user_code` varchar(255) DEFAULT '' COMMENT '新增用户编码',
  `create_user_name` varchar(255) DEFAULT '' COMMENT '新增用户名',
  `last_upd_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_upd_user_code` varchar(255) DEFAULT '' COMMENT '最后修改用户编码',
  `last_upd_user_name` varchar(255) DEFAULT '' COMMENT '最后修改用户名',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_oc_visitor_apply_member_id` (`member_id`),
  KEY `idx_oc_visitor_apply_member_account_code` (`member_account_code`),
  KEY `idx_oc_visitor_apply_member_id_card` (`id_card`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='网点-会员访客审核';

