  `last_upd_user_name` varchar(255) DEFAULT '' COMMENT '最后修改用户名',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='定时任务表';

