'admin','超级管理员','编辑报表/按钮','80','com.handturn.bole.sysconf.controller.SysconfQueryReportController.addSysconfQueryReportr()',' sysconfQueryReport: \"SysconfQueryReport(id=7, reportCode=10009, reportName=入库单明细查询, reportNameEn=null, reportNodeType=REPORT, sortNo=1, parentReportId=4, rootReportId=3, dataSource=base, sqlScript=SELECT \\nird.receipt_no,\\nird.related_order_no,\\nird.warehouse_code,\\nird.warehouse_name,\\nDATE_FORMAT(\\n irh.expected_arrive_date,\\n \'%Y-%m-%d\'\\n) expected_arrive_date,\\nird.client_code,\\nird.client_name,\\nird.vendor_code,\\nird.vendor_name,\\nird.delivery_location_code,\\nird.delivery_location_name,\\nird.order_type,\\nird.item_code,\\nbar.bar_code,\\nird.item_name,\\nird.total_qty,\\nird.received_qty,\\nird.purchase_price,\\nird.case_qty,\\nirh.status,\\nirh.receive_date\\nFROM inb_receipt_detail ird\\nLEFT JOIN inb_receipt_header irh ON ird.receipt_header_id = irh.id\\nLEFT JOIN (SELECT bib.item_code,GROUP_CONCAT(bib.bar_code) AS bar_code FROM bas_item_barcode bib GROUP BY bib.item_code) bar ON ird.item_code = bar.item_code\\nWHERE 1=1\\n/* AND ird.receipt_no = ${receipt_no}*/\\n/* AND ird.related_order_no = ${related_order_no}*/\\n/* AND ird.warehouse_code = ${warehouse_code}*/\\n/* AND ird.order_type = ${order_type}*/\\n/* AND irh.expected_arrive_date &gt;= ${START_expected_arrive_date} */\\n/* AND irh.expected_arrive_date &lt;  ${END_expected_arrive_date} */\\n/* AND irh.receive_date &gt;= ${START_receive_date} */\\n/* AND irh.receive_date &lt; ${END_receive_date} */\\n/* AND ird.item_code IN (SELECT item_code FROM bas_item_barcode where item_code = ${bar_code} or bar_code = ${bar_code})*/, sqlSortScript=ORDER BY receipt_no,item_code, status=ENABLED, description=, parentReportName=统计报表, rootReportName=WMS报表)\"','192.168.0.102','2020-02-13 11:19:49','内网IP|0|0|内网IP|内网IP'),(4045,'admin','超级管理员','编辑字典类型/按钮','50','com.handturn.bole.sysconf.controller.SysconfDictTypeController.addSysconfDictType()',' sysconfDictType: \"SysconfDictType