/*Table structure for table `sys_login_log` */

DROP TABLE IF EXISTS `sys_login_log`;

CREATE TABLE `sys_login_log` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_code` varchar(50) NOT NULL COMMENT '用户编码',
  `user_name` varchar(50) NOT NULL COMMENT '用户名',
  `login_time` datetime NOT NULL COMMENT '登录时间',
  `location` varchar(50) DEFAULT '' COMMENT '登录地点',
  `ip` varchar(50) DEFAULT '' COMMENT 'ip地址',
  `system` varchar(50) DEFAULT '' COMMENT '操作系统',
  `browser` varchar(50) DEFAULT '' COMMENT '浏览器',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1025 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='登录日志表';

