/*Table structure for table `sys_oc_report` */

DROP TABLE IF EXISTS `sys_oc_report`;

CREATE TABLE `sys_oc_report` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `oc_id` bigint(20) DEFAULT '0' COMMENT '网点id',
  `report_id` bigint(20) DEFAULT '0' COMMENT '报表id',
  `record_version` bigint(19) NOT NULL DEFAULT '0' COMMENT '版本编码',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `create_user_code` varchar(255) DEFAULT '' COMMENT '新增用户编码',
  `create_user_name` varchar(255) DEFAULT '' COMMENT '新增用户名',
  `last_upd_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_upd_user_code` varchar(255) DEFAULT '' COMMENT '最后修改用户编码',
  `last_upd_user_name` varchar(255) DEFAULT '' COMMENT '最后修改用户名',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_sys_oc_report` (`report_id`,`oc_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='系统-网点报表';

/*Data for the table `sys_oc_report` */

/*Table structure for table `sys_oc_resource` */

DROP TABLE IF EXISTS `sys_oc_resource`;

CREATE TABLE `sys_oc_resource` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `oc_id` bigint(20) DEFAULT '0' COMMENT '网点id',
  `resource_id` bigint(20) DEFAULT '0' COMMENT '资源id',
  `record_version` bigint(19) NOT NULL DEFAULT '0' COMMENT '版本编码',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `create_user_code` varchar(255) DEFAULT '' COMMENT '新增用户编码',
  `create_user_name` varchar(255) DEFAULT '' COMMENT '新增用户名',
  `last_upd_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_upd_user_code` varchar(255) DEFAULT '' COMMENT '最后修改用户编码',
  `last_upd_user_name` varchar(255) DEFAULT '' COMMENT '最后修改用户名',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_sys_oc_resource` (`resource_id`,`oc_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=16276 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='系统-网点资源';

