/*Table structure for table `sys_organization` */

DROP TABLE IF EXISTS `sys_organization`;

CREATE TABLE `sys_organization` (
  `id` bigint(10) NOT NULL AUTO_INCREMENT,
  `org_code` varchar(50) NOT NULL DEFAULT '' COMMENT '组织编号',
  `org_name` varchar(255) DEFAULT '' COMMENT '组织名称',
  `org_short_name` varchar(100) DEFAULT '' COMMENT '组织简称',
  `address` varchar(1024) DEFAULT '' COMMENT '地址',
  `region` varchar(50) DEFAULT '' COMMENT '区域',
  `city` varchar(50) DEFAULT '' COMMENT '城市',
  `province` varchar(50) DEFAULT '' COMMENT '省份',
  `country` varchar(25) DEFAULT '' COMMENT '国家',
  `post_code` varchar(10) DEFAULT '' COMMENT '邮编',
  `tel` varchar(128) DEFAULT '' COMMENT '电话',
  `cell` varchar(128) DEFAULT '' COMMENT '手机',
  `fax` varchar(128) DEFAULT '' COMMENT '传真',
  `email` varchar(128) DEFAULT '' COMMENT '邮箱',
  `attention_to` varchar(128) DEFAULT '' COMMENT '联系人',
  `remark` varchar(1024) DEFAULT '' COMMENT '备注',
  `status` varchar(50) DEFAULT 'ENABLED' COMMENT '状态: ENABLED-有效;DISABLED-无效',
  `org_type` varchar(50) DEFAULT '' COMMENT '组织类别(SYS-系统组织,ORG-客户组织)',
  `relate_oc_id` bigint(20) DEFAULT '0' COMMENT '关联中心网点id',
  `relate_role_id` bigint(20) DEFAULT '0' COMMENT '关联管理员角色Id',
  `relate_user_id` bigint(20) DEFAULT '0' COMMENT '关联管理员用户Id',
  `relate_dep_id` bigint(20) DEFAULT '0' COMMENT '关联中心部门Id',
  `logo_file_name` varchar(50) DEFAULT '' COMMENT 'Logo文件名',
  `logo_file_path` varchar(255) DEFAULT '' COMMENT 'Logo文件路径',
  `logo_request_url` varchar(255) DEFAULT '' COMMENT 'Logo文件访问路径',
  `record_version` bigint(19) NOT NULL DEFAULT '0' COMMENT '版本编码',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `create_user_code` varchar(255) DEFAULT '' COMMENT '新增用户编码',
  `create_user_name` varchar(255) DEFAULT '' COMMENT '新增用户名',
  `last_upd_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_upd_user_code` varchar(255) DEFAULT '' COMMENT '最后修改用户编码',
  `last_upd_user_name` varchar(255) DEFAULT '' COMMENT '最后修改用户名',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_bas_organization` (`org_code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='系统-组织';

