/*Table structure for table `sys_resource` */

DROP TABLE IF EXISTS `sys_resource`;

CREATE TABLE `sys_resource` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `resource_code` varchar(100) DEFAULT '' COMMENT '菜单编码',
  `resource_name` varchar(255) DEFAULT '' COMMENT '菜单名称',
  `resource_name_en` varchar(255) DEFAULT '' COMMENT '菜单英文名',
  `resource_node_type` varchar(50) DEFAULT '' COMMENT '//菜单类型:MENU_ROOT-根目录;MENU_DIR-目录;MENU-菜单;RESOURCE_COMPONENT-按钮,MENU_ACTION-请求',
  `sort_no` int(11) DEFAULT '0' COMMENT '排序',
  `parent_resource_id` bigint(20) DEFAULT '0' COMMENT '父节点id',
  `root_resource_id` bigint(20) DEFAULT '0' COMMENT '根节点id',
  `url` varchar(255) DEFAULT '' COMMENT '菜单访问路径',
  `perms` varchar(255) DEFAULT '' COMMENT '权限标识',
  `status` varchar(100) DEFAULT 'ENABLED' COMMENT '状态: ENABLED-有效;DISABLED-无效',
  `icon` varchar(255) DEFAULT '' COMMENT '图标',
  `is_open_window` tinyint(1) DEFAULT '0' COMMENT '是否弹窗(1:是 0:否)，点击菜单时是否新开窗口',
  `description` varchar(255) DEFAULT '' COMMENT '描述',
  `record_version` bigint(19) NOT NULL DEFAULT '0' COMMENT '版本编码',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `create_user_code` varchar(255) DEFAULT '' COMMENT '新增用户编码',
  `create_user_name` varchar(255) DEFAULT '' COMMENT '新增用户名',
  `last_upd_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_upd_user_code` varchar(255) DEFAULT '' COMMENT '最后修改用户编码',
  `last_upd_user_name` varchar(255) DEFAULT '' COMMENT '最后修改用户名',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_sys_resource` (`resource_code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1741 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='系统-资源';

