/*Table structure for table `sys_user` */

DROP TABLE IF EXISTS `sys_user`;

CREATE TABLE `sys_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_code` varchar(50) DEFAULT '' COMMENT '用户编码',
  `user_name` varchar(100) DEFAULT '' COMMENT '用户名称',
  `org_id` bigint(10) DEFAULT '0' COMMENT '系统组织id',
  `dep_id` bigint(10) DEFAULT '0' COMMENT '所属部门id',
  `oc_id` bigint(10) DEFAULT '0' COMMENT '所属营运中心id',
  `password` varchar(50) DEFAULT '' COMMENT '密码',
  `description` varchar(255) DEFAULT '' COMMENT '描述',
  `address` varchar(255) DEFAULT '' COMMENT '住址',
  `email` varchar(30) DEFAULT '' COMMENT '邮箱',
  `mobile` varchar(30) DEFAULT '' COMMENT '手机',
  `phone` varchar(30) DEFAULT '' COMMENT '电话',
  `login_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '登陆时间',
  `status` varchar(30) DEFAULT 'ENABLED' COMMENT '状态: ENABLED-有效;DISABLED-无效',
  `is_sys_create` tinyint(1) DEFAULT '0' COMMENT '是否系统创建 0-否，1-是',
  `sex` varchar(10) DEFAULT '' COMMENT '性别(male:男,female:女)',
  `theme` varchar(10) DEFAULT '' COMMENT '主题',
  `avatar` varchar(100) DEFAULT '' COMMENT '头像',
  `first_login` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否首次登陆 0不是 1是',
  `record_version` bigint(19) NOT NULL DEFAULT '0' COMMENT '版本编码',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `create_user_code` varchar(50) DEFAULT '' COMMENT '新增用户编码',
  `create_user_name` varchar(100) DEFAULT '' COMMENT '新增用户名',
  `last_upd_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_upd_user_code` varchar(50) DEFAULT '' COMMENT '最后修改用户编码',
  `last_upd_user_name` varchar(100) DEFAULT '' COMMENT '最后修改用户名',
  `is_tab` char(1) DEFAULT '1' COMMENT '是否开启tab，0关闭 1开启',
  `command_code` varchar(50) DEFAULT '' COMMENT '管理口令代码',
  `command_expires_time` datetime DEFAULT NULL COMMENT '管理口令失效时间',
  `is_bind_member` char(1) DEFAULT '0' COMMENT '是否已绑定前端账号',
  `member_id` bigint(19) DEFAULT NULL COMMENT '会员ID',
  `member_account_code` varchar(50) DEFAULT '' COMMENT '前端账号编码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_sys_user` (`user_code`),
  KEY `idx_sys_user_member_account_code` (`member_account_code`),
  KEY `idx_sys_user_command_code` (`command_code`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='系统-用户';

