/*Table structure for table `sysconf_code_rule` */

DROP TABLE IF EXISTS `sysconf_code_rule`;

CREATE TABLE `sysconf_code_rule` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `rule_code` varchar(50) NOT NULL DEFAULT '' COMMENT '规则编号',
  `rule_name` varchar(50) NOT NULL DEFAULT '' COMMENT '规则名称',
  `rule_code_str` varchar(255) DEFAULT '' COMMENT '规则串',
  `rule_seq_init` bigint(19) DEFAULT '0' COMMENT '流水初始值',
  `remark` varchar(2014) DEFAULT '' COMMENT '备注',
  `status` varchar(10) NOT NULL DEFAULT '' COMMENT '状态: enabled-有效;disabled-无效',
  `is_sys_created` char(1) DEFAULT '0' COMMENT '是否系统创建(1:是 0:否)，系统创建的记录不能前台修改和删除',
  `record_version` bigint(19) NOT NULL DEFAULT '0' COMMENT '数据版本',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `create_user_code` varchar(255) DEFAULT '' COMMENT '新增用户编码',
  `create_user_name` varchar(255) DEFAULT '' COMMENT '新增用户名',
  `last_upd_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_upd_user_code` varchar(255) DEFAULT '' COMMENT '最后修改用户编码',
  `last_upd_user_name` varchar(255) DEFAULT '' COMMENT '最后修改用户名',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_sysconf_code_rule` (`rule_code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='系统配置-编码规则';

