  `is_sys_created` char(1) CHARACTER SET utf8 DEFAULT '0' COMMENT '是否系统创建(1:是 0:否)，系统创建的记录不能前台修改和删除',
  `record_version` bigint(19) NOT NULL DEFAULT '0' COMMENT '数据版本',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `create_user_code` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT '新增用户编码',
  `create_user_name` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT '新增用户名',
