  `last_upd_user_code` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT '最后修改用户编码',
  `last_upd_user_name` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT '最后修改用户名',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_sysconf_code_rule_seq` (`rule_code`,`rule_code_key`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=171 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='系统配置-编码流水';

