/*Table structure for table `sysconf_dict_code` */

DROP TABLE IF EXISTS `sysconf_dict_code`;

CREATE TABLE `sysconf_dict_code` (
  `id` bigint(10) NOT NULL AUTO_INCREMENT,
  `code_value` varchar(128) DEFAULT '' COMMENT '数据字典值',
  `display_value_en` varchar(100) DEFAULT '' COMMENT '英文展现',
  `display_value_cn` varchar(100) DEFAULT '' COMMENT '中文展现',
  `type_code` varchar(50) NOT NULL DEFAULT '' COMMENT '数据字典类型编码',
  `order_num` bigint(4) DEFAULT '0' COMMENT '排序',
  `remark` varchar(1024) DEFAULT '' COMMENT '备注',
  `status` varchar(10) NOT NULL DEFAULT '' COMMENT '状态: enabled-有效;disabled-无效',
  `record_version` bigint(19) NOT NULL DEFAULT '0' COMMENT '版本编码',
  `is_sys_created` char(1) DEFAULT '0' COMMENT '是否系统创建(1:是 0:否)，系统创建的记录不能前台修改和删除',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '新增时间',
  `create_user_code` varchar(255) DEFAULT '' COMMENT '新增用户编码',
  `create_user_name` varchar(255) DEFAULT '' COMMENT '新增用户名',
  `last_upd_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_upd_user_code` varchar(255) DEFAULT '' COMMENT '最后修改用户编码',
  `last_upd_user_name` varchar(255) DEFAULT '' COMMENT '最后修改用户名',
  PRIMARY KEY (`id`),
  KEY `uk_sysconf_dict_code` (`type_code`,`code_value`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10527 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='系统-数据字典明细';

